import Card from '../UI/Card';
import classes from './NewMeetup.module.css'

function NewMeetup ()
{
    return <Card>
        <form className={classes.form}>
        <div className={classes.control}>
            <label htmlFor="title" >
             Meetup Title;
            </label>
            <input type="text" required id="title"/>

        </div>
        </form>
    </Card>
}

export default NewMeetup;
